(3032, 1, 1, 'Дельфин', 1286196205, ' С бота стандартно дают 30 опыта, сейчас... На 0-ом, уровне, давали изредка по 60. Возможно только мне, т.к. убиваю с удара... ', '0', 'ETF_KILLER', '', '', '', ''),
(3033, 1, 1, 'ETF_KILLER', 1286196215, ' Флуд - Повторение однотипного сообщения в чате чаще, чем три раза за две минуты. Наказывается предупреждением, при повторных нарушениях - запретом общения ', '0', '', '', '', '', ''),
(3034, 1, 1, 'ETF_KILLER', 1286196234, 'Спам - Отправка в чат бессмысленного набора букв, символов, цифр, смайлов. Сообщения не несущие смысловой нагрузки. Использование слов и выражений на языках отличных от русского в чате также расценивается как спам. Допускается написание русских слов латинскими буквами. При отправке 6-и и более одинаковых символов или смайлов наказывается предупреждением, при повторном нарушении - запретом общения', '0', '', '', '', '', ''),
(3035, 1, 1, 'Дельфин', 1286196286, 'Ну и действительно, народ испугается такого нереального кача, если бы тут было более сотни 0ых уровней, было бы нормально и никто не вякал, но в данной ситуации это слишком =)', '0', 'ETF_KILLER', '', '', '', ''),
