INSERT INTO `news` (`id`, `user`, `text`, `tema`, `data`) VALUES
(1, 'migon', 'Мы снова работаем, с доработками и изменениями, будем стремится сделать игру как можно интереснее и захватывающе! Сильно камнями в админа не кидать если вам чтото не понравится в игре. Спасибо за внимание, оставайтесь с нами!', 'Ну дождались!', '01.10.10 00:58'),
(2, 'migon', 'Сегодня были обновлены формулы расчета уварота, крита и брони в боях что обеспечит хороший баланс раскачек. Завезен шмот в магазин. Решены проблемы с получением квестового предмета, чтобы получить свой нож, тем кто его не получил, пройдите квест заново(точнее он уже пройден и осталось понажимать у старца рассказывая ему что вы все сделали...) Решена проблема с получением опыта и немного изменена сама формула получения. Напоминаю что новички получают удвоенный опыт первые 5 часов игры. Приятной игры!', 'Доработки', '04.10.10 00:34'),
(3, 'migon', 'Снова изменены формулы расчетов крита, уварота и опыта, опыт теперь зависит от количества нанесенного урона, от вашего уровня, уровня союзников и уровня противников, скоро также при расчете опыта будут учитыватся статы. Поправлена страница инфы. С завтрашнего дня займусь добавлением вещей в магазин, и потом ботов. Очень большая просьба не писать мне в icq днем так как вы меня очень сильно отвлекаете, если я свободен - я обязательно отвечу.', 'Доработки', '06.10.10 01:52'),
(4, 'migon', 'Поправлены лаги с опытом, теперь всем начисляется как положено. В магазин добавлено оружие для 1 уровня. Сделаны последние коректировки в формулах.', 'Исправления и дополнения', '07.10.10 02:51');
