(2, 'ETF_KILLER', 'etf_killer@mail.ru', '8928603cd5f39e8583cf8becbc180bd2', 11, 0, '0', '', 0, 0, NULL, NULL, 0, NULL, 0, 0, 652, 99, 0, 5, 3, 4, 3, 3, 0, 16, 15, 0, 2, 32, 0, 1, 1, 0, '85.198.183.125', '', '', 0, 1, '', 'Ваша экспрессивная аргументация отнюдь не вызывает у меня,как у инвестора,антагонистической реакции отторжения,убеждая,напротив же,проявить толерантность в стремлении к достижению консенсуса при обеспечении легитимности парафируемых трансакций в том пароксизме дефолта,коллапса и потребительской корзины <br>:-) :-) :-) <br><br>Не прелюбодействуй, не воруй, не лги, не пей, но запомни, что прелюбодеяние не грех,если ты влюблён, украсть у того кто сам ворует-можно, обмануть смерть-не есть ложь,и напиться можно, только в минуты,когда счастье переполняет... <br><br>Виртуальная любовь. <br>Любимая! Я инсталлировался в тебя по уши. Ты переформатировала все мои мозги. В моей оперативной памяти еще не было ничего подобного. Моя винда глючит. При виде тебя у меня повышается тактовая частота, и винт увеличивается в объеме. Давай создадим с тобой директорию. Но сначала-романтический ужин при зажженных экранах. Можешь сама вызвать меню.Лично я предпочитаю CD-ром, но обещаю не перезагружаться. А потом мы отправимся на твой сайт. Или на мой. Мы откроем друг другу свои файлы.Я войду и выйду, войду и выйду. Без всяких зависаний. Вот увидишь, тебе понравится мой драйвер. И не беспокойся за свою материнскую плату, у меня есть антивирусы. Главное - не забывай вовремя сохраняться. Тебе нужно подумать? Хорошо. Когда будешь готова, кликни два раза, и я тут как тут. Только пожалуйста, как можно реже используй свою саундкарту. Тогда у нас с тобой будет полный и взаимный апгрейд. ', '29.10.1985', '01.10.10 00:50', '', '', 1, '', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; MRA 5.6 (build 3278); SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; InfoPath.3; .NET4.0C; .NET4.0E)', 0, NULL, NULL, 0, '0', '0', 'blue'