INSERT INTO `podzem` (`id`, `city`, `title`, `time`, `top_id`, `bottom_id`, `left_id`, `right_id`, `text`, `heal`) VALUES
(300, 1, 'Склеп', 20, 301, 0, 0, 0, '''Вы входите в <B>Мрачный склеп</B>…<BR>Это древняя пещера, из которой веет смертью. Если Вы все же осмелитесь войти, то попадете в <B>Коридор</B>.', 0),
(301, 1, 'Коридор', 20, 300, 302, 0, 307, 'Вы находитесь в <B>Коридоре</B>.<BR>Это огромный грот, стены которого устрашающе нависают над Вами… Вам холодно и страшно.<BR>На одной из стен неизвестным существом высечены слова: <I>«Вы можете вернуться назад в <B>Склеп</B>. Пройдя вперед, Вы попадете на <B>Кладбище Героев</B>. А если свернете направо, то окажетесь у <B>Подземной реки</B>»</I>.', 0),
(308, 1, 'Оранжерея', 30, 309, 307, 310, 0, 'Вы проходите в небольшой грот, который называется <B>Оранжерея</B>, и замираете в восхищении.<BR>Неизвестный древний каменотес выгравировал на стенах пещеры великолепные цветы, подобных которым Вам еще не приходилось видеть.<BR>Рассматривая идеальные гравировки на стенах, между ними Вы замечаете лаконичную надпись: <I>«Назад - к <B>Подземной реке</B>»>«Влево - на <B>Псарню</B>»</I>.', 0),
(310, 1, 'Псарня', 15, 0, 0, 0, 308, '"Вы заходите в зловещее место называемое <B>Псарней</B>. Да,да - именно про это говорил тот седовласый старец в Квестовом домике.Отсюда есть выход.Повернуть туда откуда пришли.', 0),
(317, 1, 'Зыбучие пески', 20, 305, 303, 0, 310, 'Оказавшись у <B>Зыбучих песков</B>, вы идете очень осторожно.<BR>\r\nКое где  из песка торчат черепа скелетов, это те кто не дошел. Осторожно переступая вдоль стены Вы ищете указатель.<BR>\r\nОбойдя почти всю пещеру по периметру, наконец обнаруживаете его: <I>«Три пути есть у Вас из этой пещеры. Вернуться в <B>Ущелье</B>, свернуть вправо, в <B>Коридор</B> или же по тоннелю вверх к<B>Алтарю</B>»</I>.', 0),
(307, 1, 'Подземная река', 40, 306, 0, 301, 0, 'Леденящий кожу стон ветра. Капание воды. Режущие ноги сталагмиты. <B>Подземная река</B>.<BR>\r\nУжасные бестелесные тени на стенах пещеры. Они движутся, и через некоторое время Вам начинает казаться, что Вы слышите их зловещие голоса.Зловещий всплеск пробегающей воды. Вас по-прежнему не покидает чувство тревоги, и Вы ощущаете, как оно растет.<BR>\r\nВглядываясь в неровности стен, Вы находите надпись: <I>«Повернув назад, Вы попадете в <B>Усыпальницу Королей</B>. Пройдя через узкий проход налево, окажетесь в <B>Коридоре</B>. А если не побоитесь и пройдете вперед - то попадете в <B>Оранжерею</B>»</I>.', 0),
(400, 1, 'Тупиковый Тоннель', 10, 0, 317, 0, 0, 'Осторожно ступая по сужающемуся тоннелю, Вы неожиданно наталкиваетесь на сплошную стену, выскочившую будто из неоткуда.<BR>\r\nНадпись на стене гласит: <I>«Это тупик. Возвращайтесь назад, и да помогут Вам Боги»</I>.', 0),
(306, 1, 'Усыпальница Королей', 15, 308, 307, 302, 0, 'Очутившись в <B>Усыпальнице Королей</B>, Вы испытываете благоговение.Богато украшенные могилы Королей прошлого лежат перед вами!<BR>\r\nВы шарите руками по стенам и натыкаетесь на надпись: <I>«Посмотрев назад Вы окажетесь на <B>Кладбище героев</B>, продвинувшись вперед, попадете к <B>Подземной реке</B>»</I>.<BR>\r\nНе до конца осознав смысл прочитанного, Вы уже торопитесь дальше по своему пути.', 0),
(303, 1, 'Ущелье', 45, 317, 302, 0, 0, '<B>Ущелье</B>.<BR>\r\nВы идете по краю отвесной скалы, камешки соскальзываеют у вас из под ног в глубокую пропасть… Вы ищите надписи на стенах...<BR>\r\nЕсть! <I>«Еще не поздно вернуться назад на <B>Кладбище героев</B>. А пройдя по пещере вперед, Вы окажетесь в <B>Зыбучих песках</B>»</I>.', 0),
(302, 1, 'Кладбище Героев', 30, 0, 301, 303, 306, 'Войдя на <B>Кладбище Героев</B>, Вы оказываетесь в круглой невысокой пещере, с потолка которой на Вас угрожающе смотрят острия сотен сталактитов. Слышится капание воды…<BR>\r\nМогилы великих войнов внушают уважение.\r\nИ здесь на стене проводник оставил послание для заблудившихся путников: <I>«Повернувшись назад, Вы попадете в <B>Коридор</B>. Левый проход выведет вас в <B>Ущелье</B>, а правый - в <B>Усыпальницу Королей</B>»</I>.', 0),
(305, 1, 'Алтарь', 10, 316, 317, 0, 0, 'Войдя на <B>Алтарь</B>, Вы стоите на большом великолепно испсаном каким то мастером круге...<BR>\r\nСквозь текст какойто путник оставил сообщение на стене: <I>«Повернувшись назад, Вы попадете в <B>Ущелье</B>. Если вы пойдёте прямо то попадёте в <B>Зал коронации</B></I>.\r\n', 0),
(316, 1, 'Зал Коронации', 18, 0, 305, 0, 315, '''Вы входите в <B>Зал Коронации</B>…<BR>Это древняя зал,в котором когда-то удастаивались короны воистину великие короны,сейчас же вы сдуваете пыль на большом золотом троне...\r\n Также вы увидели тайный проход,если вы зайдёте в него то возможно он вас приведёт к чему-то очень потрясающему...', 0),
(315, 1, 'Дерево Жизни', 23, 0, 0, 316, 0, '''Вы входите в <B>Дерево жизни</B>…<BR>Это древнее дерево,простоявшее и поведавшее несколько тысячилетий,только истинных путников оно пускает в себя,и вы один из них...\r\n Также вы увидели тайный проход,если вы зайдёте в него то возможно он вас приведёт к чему-то очень потрясающему...Это древо может вас изличить колодцем,находящимся внутри него.', 0),
(309, 1, 'Казармы', 13, 311, 308, 0, 0, 'Войдя в <B>Казармы</B>, Вы увидели несколько залов,соединённых между собой,в каждом из них были когда-то копья,мечи свитки,зелья,сейчас этого ничего нет,только странные,закутанные в паутине большие черепа…<BR>\r\nВ одном зале вы нашли записку,накоторой какой-то путник оставил сообщение:ещё не поздно повернуть назад путник,но если же ты пойдёшь прямо ты можешь попасть на старую арену,полную душ умерших гладиаторов.Осторожно!', 0),
(311, 1, 'Старая Арена', 26, 0, 309, 314, 0, 'Войдя на <B>Старую Арену</B> Вы увидели много душ сильных гладиаторов,когда то они дрались на этой арене в честь короля,лишь один мог выйти с арены живым и пасть в следующем бою!Некоторые души очень злы,поэтому в любой момент могут на вас напасть.', 0),
(314, 1, 'Тюрьма', 7, 0, 0, 313, 311, 'Войдя в бывшую <B>Тюрьму</B> вы нашли кости и разную старую посуду.Кроме того вам что-то показалось,как будто кто-то промелькнул перед вашими глазами.Если вы очень смелы то можете разыскать того кто вас преследовал.', 0),
(313, 1, 'Кладбище Оборотней', 25, 0, 0, 0, 314, 'Кажется это тупик...дальше идти некуда,можно лишь вернуться назад,но что то вас остановило и вы решили исследовать стены:Здесь чтото упоминается о восставших оборотнях из могил...Будте начеку!', 0);
